(1, 'TA001Y2', '<div>Marah Fayez Bakir is a Syrian single woman 21 years old , &nbsp;Her family descends from displaced poor family of five members that was living in their owned house in Rural Damascus &nbsp;area, But when the Syrian crisis broke out the family fled twice (from Rural Damascus in Zamalka area to Rikn Al-Deen for two years then Masaken Barza &nbsp;area ) &nbsp;, however the family relies on her father working as a Daily worker</div><div>in addtion to they depend on local charity assistances in order to cover their essential monthly needs.&nbsp;</div><div>I recommended registration her and covering her course cost</div>', 1, 1, 133, 0, '0000-00-00', 5, 0, 0, 1, 0, 0, '', '', 0, 1, '06/03/2017', NULL, '2017-09-25 13:08:16', 1),
