(2, 'Emergency', 'EM', 3026, '01/01/2017', '31/12/2017', 1, 2, '', '<p>&nbsp;</p>\n\n<p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <b>MDC: M</b><span>ental <b>D</b>isability <b>C</b>ondition (Epilepsy,\nSchizophrenia, Depression, poor or slow brain development and understanding).</span></p>\n\n<p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <b>PDC:</b><span> <b>P</b>hysical <b>D</b>isability <b>C</b>ondition\n(amputation of one or more limbs, inability of using of one or more limbs,\nblindness, deafness, muteness).</span></p>\n\n<p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <b>ST: S</b><span>evere <b>T</b>rauma (Witnessing a loved one being\ntortured or killed, rape, surviving any kind of traumatic event, and\ndemonstrating trauma symptoms). </span></p>\n\n<p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <b>CMC: C</b><span>hronic <b>M</b>edical <b>C</b>ondition (Long-term\nillness or disease that cannot be cured with short-term usage of medication.\nExamples are asthma, diabetes, heart disease, rheumatism, and tularemia). </span></p>\n\n<p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <b>AMC: A</b><span>cute <b>M</b>edical <b>C</b>ondition (An extremely\nsevere illness or disease that may or may not be cured with short-term\nmedication or an operation. Examples are dysentery, anemia, kidney or gall\nbladder stone, hemorrhoids, hernia &amp; sinuses). </span></p>\n\n<p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <b>TMC: T</b><span>erminal <b>M</b>edical <b>C</b>ondition ( Cancer that\nhas reached stage 3 and above, multiple sclerosis, Alzheimer).</span></p>\n\n<p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <b>SF (F/M): S</b><span>ingle <b>P</b>arents (<b>Mother</b> or <b>Father</b>,\nliving alone with children who are under the age of 18. No adult is living with\nthem or supporting them). </span></p>\n\n<p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <b>SF: Si</b><span>ngle<b> F</b>emale<b> </b>(A woman \"at risk\"\nwho is living completely on her own with no adults or relatives). </span></p>\n\n<p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <b>UAM: U</b><span>n-<b>A</b>ccompanied <b>M</b>inor (Child or children\nunder 18 who is/are living alone with no adults-relatives or otherwise).</span></p>\n\n<p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n<span>&nbsp;<b>UAE: U</b>n-<b> A</b>ccompanied<b> E</b>lder\n(A person / people over the age of 60 who is/are living alone with no\nadults-relatives or otherwise).<b></b></span></p>\n\n<p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n<b>ESC: E</b><span>lder needing <b>S</b>pecialized\n<b>C</b>are (A person over the age of 60 who needs physical aids, nursing or a\ncare-giver)<b></b></span></p>\n\n<p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n<b>EEP: E</b><span>lder in <b>E</b>xtreme\n<b>P</b>overty (A person over the age of 60 who is living on maximum of 15000\nSYP per month). <b></b></span></p>\n\n<p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n<b>FEP: F</b><span>amily <b>E</b>xtreme\n<b>P</b>overty<b> </b>(A family who is living on a maximum of 15000 SYP per\nperson per month).<b></b></span></p>\n\n<p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n<b>VOV: V</b><span>ictims <b>of</b>\n<b>V</b>iolence (Person who has been through actions of violence, torture or\nrape). <b></b></span></p>\n\n<p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n<b>PPC: P</b><span>erson with <b>P</b>rotection<b>\nC</b>oncerns (People who fled their home or country due to life threatening\nreasons or who have been threatened of abuse, Kidnapping, Rape or violence\nbecause of Discrimination Political, Religious, Ethnic or Bender based)&nbsp; <b></b></span></p>\n\n<p class=\"wysiwyg-text-align-right\">&nbsp;</p>', '2017-06-13 05:22:54', 0),
