(28, 'NFI', '', '', '<p dir=\"rtl\"><span style=\"font-size:18px\">الى عناية السادة&nbsp;%provider_name_arabic% المحترمون</span></p>\n\n<p dir=\"rtl\"><span style=\"font-size:18px\">تحية طيبة و بعد ،،</span></p>\n\n<p dir=\"rtl\"><span style=\"font-size:18px\">ان المذكور أعلاه بحاجة الى مواد منزلية وفق ما يلي :</span></p>\n\n<p dir=\"rtl\"><span style=\"font-size:18px\">%items_table%</span></p>\n\n<p dir=\"rtl\"><span style=\"font-size:18px\">لذلك نرجو التفضل بتقديم المساعدة المطلوبة له ، علما بأن المشروع سوف يتكفل بمبلغ و قدره &nbsp;%total_value%</span></p>\n\n<p dir=\"rtl\"><span style=\"font-size:18px\">و كتابة&nbsp;%total_value_string%</span></p>\n', '      ', '      ', 1, 18, '2017-08-10 07:21:14', 0, 0, '[\"item_arabic\",\"count\",\"total_value\"]'),
(29, 'Rent', '', '', '<p style=\"direction:rtl\">&nbsp;</p>\n\n<p style=\"direction:rtl\"><span style=\"font-size:18px\">الى عناية السيد / السيدة&nbsp;%renter_name%</span></p>\n\n<p style=\"direction:rtl\"><span style=\"font-size:18px\">تحية طيبة و بعد ،،</span></p>\n\n<p style=\"direction:rtl\"><span style=\"font-size:18px\">يرجى تأكيد استلام مبلغ و قدره %total_value%&nbsp;و كتابة&nbsp;%total_value_string% ليرة سورية فقط لا غير.</span></p>\n\n<p style=\"direction:rtl\"><span style=\"font-size:18px\">وذلك لقاء اجار لمدة&nbsp;%count%&nbsp;أشهر اعتبارا من تاريخ&nbsp;%start_date%&nbsp;و حتى تاريخ&nbsp;%end_date%</span></p>\n\n<p style=\"direction:rtl\">&nbsp;</p>\n', '       ', '       ', 1, 18, '2017-08-10 07:23:31', 0, 0, 'false'),
(30, 'Education Format', '', '', '<p style=\"text-align:right\">&nbsp;</p>\n\n<p style=\"text-align:right\">الى عناية السادة %provider_name_arabic% المحترمون</p>\n\n<p style=\"text-align:right\">الموضوع : دورة تقوية</p>\n\n<p style=\"text-align:right\">يسرنا أن نعلمكم ان الطالبة / الطالب المذكور/ ة أعلاه&nbsp;&nbsp;قد راجع / راجعت هذه &nbsp;الجمعية طالبا / طالبة المساعدة بالدورة التعليمية و عليه &nbsp;فقد تقرر أن تقوم الجمعية بتغطية كافة النفقات &nbsp;المتعلقة بالدورة التعليمية .</p>\n\n<p style=\"text-align:right\">يرجى التكرم باعلامنا دوريا عن مواظبة الطالب / الطالبة بالحضور و الدراسة و تزويدنا بصور طبق الأصل&nbsp;عن شهاداتها الدراسية و معدلات تحصيلها عند استحقاقها .وفي حال الالتزام بالدوام و تحقيق الغاية من دورة التقوية سيتم تزويد الطالب بما يلي :</p>\n\n<p style=\"text-align:right\">%items_table%</p>\n\n<p style=\"text-align:right\">سيتم تغطية نفقات المواد المذكورة أعلاه من قبل الجمعية و البالغ قيمتها&nbsp;%total_value%</p>\n\n<p style=\"text-align:right\">وكتابة&nbsp;%total_value_string%</p>\n\n<p style=\"text-align:right\">&nbsp;</p>\n\n<p style=\"text-align:right\">&nbsp;</p>\n\n<p style=\"text-align:right\">&nbsp;</p>\n\n<p style=\"text-align:right\">&nbsp;</p>\n\n<p style=\"text-align:right\">&nbsp;</p>\n', 'Logo.jpg          ', '           ', 1, 0, '2017-08-11 06:51:04', 1, 0, 'false'),
(31, 'Vocational Format', '', '', '<p style=\"direction:rtl\">الى عناية السادة&nbsp;%provider_name_arabic% المحترمون</p>\n\n<p style=\"direction:rtl\">الموضوع : دورة مهنية /&nbsp;%service_name%</p>\n\n<p style=\"direction:rtl\">يسرنا أن نعلمكم ان المذكور/ ة أعلاه قد راجع/ت هذه الجمعية طالبا/ة المساعدة بالدورة المهنية المذكورة أعلاه و بناء عليه</p>\n\n<p style=\"direction:rtl\">ستتكفل الجمعية بتغطية كافة نفقات الدورة &nbsp;متضمنة أدوات ولوازم للمستفيد والبالغ قيمتها&nbsp;%value%</p>\n\n<p style=\"direction:rtl\">وكتابة&nbsp;%total_value_string%</p>\n\n<p style=\"direction:rtl\">يرجى التكرم باعلامنا دوريا عن مواظبة المذكور/ة بالحضور و الالتزام بالدوام المقرر&nbsp;</p>\n', '   ', 'Logo1.jpg  ', 0, NULL, '2017-08-11 07:55:35', 1, 0, 'false'),
